import React from 'react';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importa los estilos de Bootstrap
import './App.css';

const Menu = () => {
  return (
    <Navbar expand="lg">
      <Navbar.Brand href="#home">Mi Menú</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          {/* Menú principal */}
          <Nav.Link href="#home">Menú 1</Nav.Link>
          <Nav.Link href="#link">Menú 2</Nav.Link>
          <NavDropdown title="Menú 3" id="basic-nav-dropdown">
            {/* Submenú 1 del Menú 3 */}
            <NavDropdown.Item href="#action/3.1">Submenú 1</NavDropdown.Item>
            {/* Submenú 2 del Menú 3 */}
            <NavDropdown.Item href="#action/3.2">Submenú 2</NavDropdown.Item>
            {/* Submenú 3 del Menú 3 */}
            <NavDropdown title="Submenú 3" id="basic-nav-dropdown" className="sub-menu-item">
              <NavDropdown.Item href="#action/3.3.1">Submenú 3.1</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3.1">Submenú 3.2</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3.1">Submenú 3.3</NavDropdown.Item>
              {/* Agrega más niveles de submenús según necesites */}
            </NavDropdown>
          </NavDropdown>
          {/* Agrega más menús y submenús según necesites */}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Menu;
